import React, {useState} from 'react';

import { StyleSheet, Text, View, FlatList, Image, TouchableOpacity } from 'react-native';

const styles = StyleSheet.create({
  images: {
  	alignItems: 'center',
  	justifyContent: 'center',
   resizeMode: 'contain',
   shadowColor: "#000",
	shadowOffset: {
	width: 2,
	height: 2,
	},
	shadowOpacity: 3.29,
	shadowRadius: 6.65,
	elevation: 1,
  }
});


function KatsItem ({item, navigation, id}) {


	return (
	<View style={{
			flex: 1,
			flexDirection: 'row',
			height: 'auto',
	        borderRadius: 16,
	        margin: 8,
	      }}
	      >
	      <TouchableOpacity onPress={() => {
	      	navigation.navigate('kats view', {
	      		itemId: item.id
	      	})
	      }}>
			<Image
			style={styles.images}
          	source={{
            width: 150,
            height: 260,
            uri: item.preview
        }}
          />
          </TouchableOpacity>
          <View style={{justifyContent: 'center', alignItems:'flex-end'}}>
	          <Text style={{fontSize: 40}}>
	          {item.cat}	
	          </Text>
	      </View>	         
		</View>
	)
}

export default KatsItem;
